import React from 'react'
// import { RoomContext } from '../context'
import {Link} from "react-router-dom"
import LoginNavBar from '../logincomponents/LoginNavBar'
// import { withRoomConsumer } from "../context";
import {FcHome} from "react-icons/fc"

import BookedRoom from "../components/BookedRoom";
// import SingleRoom from './SingleRoom';


const BookedProperties = ({room}) => { 

    const {slug} = room;
    return (
        <div>
            <LoginNavBar/>
            <br/>
            <br/>
            <br/>            
            <h6>Your Booked Property:<FcHome size={40}/></h6>   
            <BookedRoom><Link to ={`/rooms/${slug}`} className="btn-primary room-link">
                    Explore More
                    </Link></BookedRoom>         
            <Link to='/Login' className="btn-primary">Login</Link>            
            
        </div>


    )
}

export default BookedProperties

